	(1, 'Azure', 'Azure', '2024-09-10 03:30:00.000000', '2024-09-13 16:30:00.000000', 'Amal Jyothi College of Engineering, Koovappally, Kerala, India', '9.528631800000001,76.8234568', '2024-08-28 14:58:51.186709', '2024-09-01 17:40:47.833288', 'completed', 2, 5, 5, 0.00, 'event_covers/7d393594f0d7a23c346cffff5c4b659d.jpg', 9.528631800000001, 76.8234568, NULL, NULL, 0, NULL),
	(2, 'Freshers Day', 'Fresh day', '2024-09-02 02:30:00.000000', '2024-09-02 15:30:00.000000', 'Amal Jyothi College of Engineering, Koovappally, Kerala, India', '9.528631800000001,76.8234568', '2024-08-29 06:20:21.348353', '2024-09-01 17:40:59.367272', 'completed', 2, 5, 14, 100.00, 'event_covers/17cc3bbcc7574d0023c483d26d37c669.jpg', 9.528631800000001, 76.8234568, NULL, NULL, 0, NULL),
	(3, 'Onam Festival', 'Join us as we celebrate the vibrant and joyous festival of Onam! Our club is excited to bring together members for a day filled with traditional Kerala festivities, including the mesmerizing Pookalam (floral carpet) competition, exciting games, cultural performances, and a delicious Onam Sadhya (feast). LetÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢s come together to honor this harvest festival and experience the rich culture and traditions of Kerala. Everyone is welcome to participate and make this Onam celebration a memorable one!', '2024-09-15 03:30:00.000000', '2024-09-15 15:30:00.000000', 'Eramalloor, Ezhupunna, Kerala, India', '9.8234702,76.3111052', '2024-08-31 06:59:52.630601', '2024-09-03 09:24:27.155318', 'completed', 1, 7, 5, 200.00, 'event_covers/medium-shoppingdream-happy-onam-poster-size-12x18inch-paper-original-imafx_WgXANNP.jpeg', 9.8234702, 76.3111052, 'Eramalloor friends club', NULL, 0, NULL),
	(4, 'Inaguration of Baker Buddies', 'Join us for the grand opening of Baker Buddies, a community of passionate bakers coming together to share their love for the art of baking! Whether you\'re a seasoned professional or a novice in the kitchen, Baker Buddies is the perfect place to connect with fellow enthusiasts, exchange recipes, and hone your skills. Our inaugural event will feature live baking demonstrations, a variety of baked goods to sample, and a chance to meet the founding members of our community.\r\n\r\nBring your favorite baked creation to share, and let\'s celebrate the start of this exciting journey into the world of flour, sugar, and endless creativity!', '2024-09-10 05:00:00.000000', '2024-09-10 10:00:00.000000', 'Manimala, Kerala, India', '9.4948608,76.7466378', '2024-09-06 04:16:42.271102', '2024-09-06 04:16:42.271102', 'completed', 1, 7, 7, 0.00, 'event_covers/restaurant-mural-wallpaper_52683-47921.jpg', 9.4948608, 76.7466378, 'Lions Club Manimala', NULL, 0, NULL),
	(2005, 'MASS Football Tournament', 'Join us for an auspicous celebration of football.', '2024-09-28 04:30:00.000000', '2024-10-05 11:30:00.000000', 'St. Mary\'s Higher Secondary School, Road, Kidangoor, Kerala, India', '9.685032999999999,76.61159669999999', '2024-09-23 14:31:47.278301', '2024-09-23 14:31:47.278301', 'completed', 1, 7, 9, 0.00, 'event_covers/71UbVaxE3L._AC_UF8941000_QL80_.jpg', 9.685032999999999, 76.61159669999999, 'St. Mary\'s Higher Secondary School Ground', NULL, 0, NULL),
	(2006, 'Hacktober Fest', 'Join us this october for proving your skills in coding and get some goodies on the way.', '2024-10-15 03:30:00.000000', '2024-10-17 11:30:00.000000', 'Amal Jyothi College of Engineering, Koovappally, Kerala, India', '9.528631800000001,76.8234568', '2024-09-23 14:37:12.542425', '2024-09-23 14:37:12.542425', 'ongoing', 2, 5, 11, 500.00, 'event_covers/666c2d1e92c339cc8a17bbf3_650c3fd8a7eac6a0eb56fc22_hacktoberfest-hero.png', 9.528631800000001, 76.8234568, 'At Alphonsa Hall, AJCE', NULL, 0, NULL),
	(2007, 'Car Meetup', 'The biggest car meetup in Kottayam', '2024-10-20 09:30:00.000000', '2024-10-20 15:30:00.000000', 'Pampady, Kerala, India', '9.5656567,76.6441591', '2024-09-24 04:02:31.575744', '2024-09-24 04:02:31.575744', 'upcoming', 3, 2, 10, 0.00, 'event_covers/images.jpg', 9.5656567, 76.6441591, 'At School ground', NULL, 0, NULL),
	(2008, 'Deepavali', 'Diwali is a five-day festival that celebrates the triumph of light over darkness, new beginnings, and the victory of good over evil', '2024-10-30 22:30:00.000000', '2024-10-31 17:30:00.000000', 'Ettumanoor Mahadeva Temple, Ettumanoor Temple Road, Ettumanoor, Kerala, India', '9.673661399999999,76.5604709', '2024-10-16 05:58:32.271957', '2024-10-16 05:58:32.271957', 'upcoming', 1, 7, 5, 0.00, 'event_covers/udayaditya-barua-xisPXJqwQkA-unsplash_1635850538465_1635850559409.webp', 9.673661399999999, 76.5604709, 'Temple grounds Ettumanoor Temple', NULL, 0, NULL);
